import React, { useState } from "react";
import { Link } from "react-router-dom";

const DailyChallenge = () => {
  const [streak, setStreak] = useState(3);
  const [weekProgress, setWeekProgress] = useState([
    "✅",
    "✅",
    "✅",
    "",
    "",
    "",
    "",
  ]);
  const [showWheel, setShowWheel] = useState(false);

  const handleStartWorkout = () => {
    const today = new Date().getDay(); // 0 (Sun) - 6 (Sat)
    const index = today === 0 ? 6 : today - 1; // Adjust to Mon-Sun array
    const updated = [...weekProgress];
    updated[index] = "✅";
    setWeekProgress(updated);
    setStreak((prev) => prev + 1);
    setShowWheel(true);
  };

  return (
    <div style={styles.container}>
      <h1 style={styles.title}>🏋️ Daily Challenge</h1>
      <p style={styles.subtitle}>
        Complete your workout to gain XP and build your streak!
      </p>

      {/* 🔥 Streak Tracker */}
      <div style={styles.card}>
        <h2>🔥 Streak: {streak} Days</h2>
        <p style={styles.hint}>
          Keep it up! Reach <span style={styles.highlight}>5 Days</span> to earn
          a reward.
        </p>
      </div>

      {/* 🗓️ Weekly Progress */}
      <div style={styles.card}>
        <h2>🗓️ This Week</h2>
        <div style={styles.calendar}>
          {["Mon", "Tue", "Wed", "Thu", "Fri", "Sat", "Sun"].map((day, i) => (
            <div
              key={day}
              style={{
                ...styles.dayBox,
                backgroundColor:
                  weekProgress[i] === "✅" ? "#28a745" : "#e0e0e0",
                color: weekProgress[i] === "✅" ? "#fff" : "#000",
              }}
            >
              {day} {weekProgress[i]}
            </div>
          ))}
        </div>
      </div>

      {/* ✅ Start Workout Button */}
      <button onClick={handleStartWorkout} style={styles.startButton}>
        Start Workout
      </button>

      {/* 🎡 Bonus Wheel */}
      {showWheel && (
        <div style={styles.card}>
          <h2>🎡 Spin Bonus Wheel</h2>
          <button
            style={styles.spinButton}
            onClick={() => alert("🎉 You won +50 XP!")}
          >
            Spin Now
          </button>
          <p style={styles.hint}>Chance to win XP, power-ups & more!</p>
        </div>
      )}

      {/* ⬅️ Back to Map */}
      <Link to="/adventure-map" style={styles.backLink}>
        ← Back to Adventure Map
      </Link>
    </div>
  );
};

const styles = {
  container: {
    maxWidth: "600px",
    margin: "40px auto",
    padding: "20px",
    fontFamily: "sans-serif",
    textAlign: "center",
  },
  title: {
    fontSize: "32px",
    fontWeight: "bold",
    marginBottom: "10px",
  },
  subtitle: {
    fontSize: "16px",
    color: "#555",
    marginBottom: "30px",
  },
  card: {
    backgroundColor: "#f9f9f9",
    borderRadius: "12px",
    padding: "20px",
    marginBottom: "20px",
    boxShadow: "0 4px 12px rgba(0,0,0,0.1)",
  },
  calendar: {
    display: "grid",
    gridTemplateColumns: "repeat(7, 1fr)",
    gap: "10px",
    marginTop: "10px",
  },
  dayBox: {
    padding: "10px",
    borderRadius: "8px",
    fontWeight: "bold",
    fontSize: "14px",
  },
  startButton: {
    padding: "12px 25px",
    backgroundColor: "#28a745",
    color: "#fff",
    border: "none",
    borderRadius: "8px",
    fontSize: "16px",
    fontWeight: "bold",
    cursor: "pointer",
    marginBottom: "20px",
  },
  spinButton: {
    padding: "10px 20px",
    backgroundColor: "#ffd700",
    border: "none",
    borderRadius: "8px",
    fontWeight: "bold",
    cursor: "pointer",
  },
  backLink: {
    display: "inline-block",
    marginTop: "20px",
    color: "#007bff",
    textDecoration: "none",
    fontWeight: "bold",
  },
  hint: {
    marginTop: "10px",
    fontSize: "14px",
    color: "#666",
  },
  highlight: {
    color: "#ff6347",
    fontWeight: "bold",
  },
};

export default DailyChallenge;
